return ['x-generator'=>'GlotPress/4.0.1','translation-revision-date'=>'2025-05-13 17:00:58+0000','plural-forms'=>'nplurals=2; plural=n != 1;','project-id-version'=>'Plugins - WP phpMyAdmin - Development (trunk)','language'=>'sv_SE','messages'=>['Last error: '=>'Senaste felet: ','You do not have enough privilegges to open this page.'=>'Du har inte tillräckligt med behörigheter för att öppna denna sida.','Error: could not create the session file. '=>'Fel: kunde inte skapa sessionsfilen. ','Show primary status'=>'Visa primär status','Session not found.'=>'Session hittades inte.','Column name copying to clipboard failed!'=>'Misslyckades att kopiera kolumnnamn till urklipp!','Column name successfully copied to clipboard!'=>'Kolumnnamn har kopierats till urklipp!','Unlock this account.'=>'Lås upp detta konto.','Lock this account.'=>'Lås detta konto.','You are about to DELETE all the rows of the table!'=>'Du är på väg att TA BORT alla rader i tabellen!','Private key for reCAPTCHA'=>'Privat nyckel för reCAPTCHA','Public key for reCAPTCHA'=>'Offentlig nyckel för reCAPTCHA','URL for reCAPTCHA v2 API'=>'URL för reCAPTCHA v2 API','Proxy URL'=>'Proxy-URL','Enter local phpMyAdmin'=>'Ange lokal phpMyAdmin','Install all languages for PhpMyAdmin:'=>'Installera alla språk för PhpMyAdmin:','https://puvox.software/software/wordpress-plugins/?plugin=wp-phpmyadmin-extension'=>'https://puvox.software/software/wordpress-plugins/?plugin=wp-phpmyadmin-extension','Import settings'=>'Importera inställningar','Export settings'=>'Exportera inställningar','You do not have InnoDB enabled.'=>'Du har inte InnoDB aktiverat.','Is InnoDB disabled?'=>'Är InnoDB inaktiverat?','Percentage of used connections'=>'Procent av använda anslutningar','Increase {thread_cache_size}.'=>'Öka {thread_cache_size}.','key_buffer_size is 0'=>'key_buffer_size är 0','Current values are tmp_table_size: %s, max_heap_table_size: %s'=>'Nuvarande värden är tmp_table_size: %s, max_heap_table_size: %s','{tmp_table_size} and {max_