en to intrusion; you really should fix this security weakness by changing the password for controluser \'pma\'.'=>'Din server använder standardvärdena för controluser och lösenord (controlpass) och är öppen för intrång. Du bör verkligen åtgärda detta säkerhetshål genom att byta lösenord för controluser ”pma”.','No newer stable version is available'=>'Ingen senare stabil version är tillgänglig','You are using Git version, run [kbd]git pull[/kbd] :-)[br]The latest stable version is %s, released on %s.'=>'Du använder Git versionshantering, kör [kbd]git pull[/kbd] :-)[br]Senaste stabila version är %s och den utkom %s.','Unparsable version string'=>'Verionssträngen går inte att tolka','Got invalid version string from server'=>'Ogiltig versionssträng mottogs från servern','Reading of version failed. Maybe you\'re offline or the upgrade server does not respond.'=>'Det gick inte att avläsa versionen. Du kanske är offline, eller så svarade inte uppdateringsservern.','The ini_get and/or ini_set functions are disabled in php.ini. phpMyAdmin requires these functions!'=>'Funktionerna ini_get och/eller ini_set är inaktiverade i php.ini. Dessa funktioner krävs för phpMyAdmin!','Whether to expand single database in the navigation tree automatically.'=>'Om en enstaka databas ska expanderas automatiskt i navigeringsträdet eller inte.','Expand single database'=>'Expandera den enda databasen','Uncheck the checkbox to disable drag and drop import'=>'Avmarkera kryssrutan för att inaktivera import via dra och släpp','Enable drag and drop import'=>'Aktivera import via dra och släpp','%s view'=>'Vyn %s','Exclude definition of current user'=>'Uteslut definitionen för den egna användarprofilen','Groups'=>'Grupper','You do not have the privileges to administrate the users!'=>'Du saknar behörighet att administrera användare!','Copying failed!'=>'Kopieringen misslyckades!','Successfully copied!'=>'Kopieringen klar!','You have a previously saved query. Click Get auto-saved query to load the query