re:'=>'Om ovanstående metod inte fungerar för dig kan du använda en alternativ lösning – vissa webbhotell kanske redan har installerat phpMyAdmin för sina kunder. I så fall behöver du bara klistra in URL:en till inloggningssidan för phpMyAdmin här:','Hide errors in PMA <br/>(if you face error popup-boxes in phpMyAdmin frequently, you can hide them)'=>'Dölj fel i phpMyAdmin <br/>(om du ofta får popup-rutor med felmeddelanden i phpMyAdmin kan du dölja dem)','Plugin activable only from'=>'Tillägget kan endast aktiveras från','NOTE: Sharing or unauthorized use of the license will be ended with the suspension of the license code.'=>'Obs: Delning eller obehörig användning av licensen leder till att licenskoden upphävs.','Thanks! License is activated for this domain.'=>'Tack! Licensen är aktiverad för denna domän.','https://puvox.software/'=>'https://puvox.software/','Seems you have bought a PRO version, but the addon is not installed.'=>'Du verkar ha köpt en PRO-version, men utökningen är inte installerad.','After purchase'=>'Efter köpet','Failed to set session cookie. Maybe you are using HTTP instead of HTTPS to access phpMyAdmin.'=>'Lyckades inte ange sessions-cookie. Du kanske öppnar phpMyAdmin via HTTP istället för HTTPS.','You attempted to load file with unsupported compression (%s). Either support for it is not implemented or disabled by your configuration.'=>'Du försökte ladda en fil med en komprimering (%s) som inte stöds. Antingen är detta inte implementerat, eller inaktiverat i din konfiguration.','The uploaded file exceeds the MAX_FILE_SIZE directive that was specified in the HTML form.'=>'Den uppladdade filen överskrider direktivet MAX_FILE_SIZE som specificerades i HTML-formuläret.','The uploaded file exceeds the upload_max_filesize directive in php.ini.'=>'Den uppladdade filen överskrider direktivet upload_max_filesize i php.ini.','Only INSERT, UPDATE, DELETE and REPLACE SQL queries containing transactional engine tables can be rolled back.'=>'Enda Infoga, uppdatera, ta bort och ersätta SQL-körningar som innehåller transaktionella tabeller kan rullas tillbaka.','The number of threads created to handle connections. If Threads_created is big, you may want to increase the thread_cache_size value. (Normally this doesn\'t give a notable performance improvement if you have a good thread implementation.)'=>'Antalet trådar skapade för att hantera förbindelser. Om värdet Threads_created är stort, vill du kanske öka värdet thread_cache_size. (Normalt ger detta inte någon märkbar prestandaförbättring om du har en bra trådimplementering.)','The number of threads in the thread cache. The cache hit rate can be calculated as Threads_created/Connections. If this value is red you should raise your thread_cache_size.'=>'Antalet trådar i trådcachen. Cachens träffrekvens kan beräknas som Threads_created/Connections. Om detta värde är rött bör du öka värdet thread_cache_size.','The number of times that a table lock could not be acquired immediately and a wait was needed. If this is high, and you have performance problems, you should first optimize your queries, and then either split your table or tables or use replication.'=>'Antalet gånger som ett tabellås inte kunde förvärvas omedelbart och en väntan var nödvändig. Om detta värde är högt och du har prestandaproblem bör du först optimera dina frågor och antingen dela upp din tabell eller tabeller eller använda replikering.','The number of merge passes the sort algorithm has had to do. If this value is large, you should consider increasing the value of the sort_buffer_size system variable.'=>'Antalet sammanslagningar som sorteringsalgoritmen har behövt utföra. Om detta värde är stort bör du överväga att öka värdet i systemvariabeln sort_buffer_size.','The number of queries that have taken more than long_query_time seconds.'=>'Antalet frågor som har tagit mer än long_query_time sekunder.','The number of threads that have taken more than slow_launch_time seconds to create.'=>'Antalet frågor som har tagit mer än slow_launch_time sekunder att skapa.','The number of joins that used ranges on the first table. (It\'s normally not critical even if this is big.)'=>'Antalet kopplingar som använde urval på den första tabellen. (Det är normalt inte kritiskt även om detta är stort.)','The number of joins without keys that check for key usage after each row. (If this is not 0, you should carefully check the indexes of your tables.)'=>'Antalet kopplingar utan nycklar som kontrollerar nyckelanvändning efter varje rad. (Om detta värde inte är 0, bör du noggrant kontrollera index för dina tabeller.)','The number of joins that do not use indexes. If this value is not 0, you should carefully check the indexes of your tables.'=>'Antalet kopplingar som inte använder index. Om detta värde inte är 0, bör du noggrant kontrollera index för dina tabeller.','The number of non-cached queries (not cachable, or not cached due to the query_cache_type setting).'=>'Antalet icke-cachade frågor (inte möjliga att cacha eller inte cachade pga inställningen query_cache_type).','The number of queries that have been removed from the cache to free up memory for caching new queries. This information can help you tune the query cache size. The query cache uses a least recently used (LRU) strategy to decide which queries to remove from the cache.'=>'Antalet frågor som har tagits bort från cachen för att frigöra minne för cachning av nya frågor. Denna information kan hjälpa dig att ställa in storleken på frågecachen. Frågecachen använder strategin minst nyligen använd (LRU) för att bestämma vilka frågor som ska tas bort från cachen.','The number of free memory blocks in query cache. High numbers can indicate fragmentation issues, which may be solved by issuing a FLUSH QUERY CACHE statement.'=>'Antalet fria minnesblock i frågecache. Högt antal kan tyda på fragmentering, vilket kan lösas genom att köra ett FLUSH QUERY CACHE-kommando.','The number of tables that have been opened. If opened tables is big, your table_open_cache value is probably too small.'=>'Antalet tabeller som har öppnats. Om antalet öppnade tabeller är stort är förmodligen ditt table_cache-värde för litet.','The maximum number of connections that have been in use simultaneously since the server started.'=>'Det maximala antalet anslutningar som har använts samtidigt sedan servern startade.','The total cost of the last compiled query as computed by the query optimizer. Useful for comparing the cost of different query plans for the same query. The default value of 0 means that no query has been compiled yet.'=>'Den totala kostnaden för den senaste kompilerade frågan enligt beräkning av frågeoptimeraren. Användbart vid jämförelse av kostnad för olika frågesätt av samma fråga. Standardvärdet 0 innebär att ingen fråga har kompilerats ännu.','Percentage of physical writes compared to write requests (calculated value)'=>'Andel fysiska skrivningar jämfört med läsbegäran (beräknat värde)','Key cache miss calculated as rate of physical reads compared to read requests (calculated value)'=>'Misslyckad nyckelcache beräknas som andelen fysiska läsningar jämfört med läsbegäran (beräknat värde)','The number of physical reads of a key block from disk. If Key_reads is big, then your key_buffer_size value is probably too small. The cache miss rate can be calculated as Key_reads/Key_read_requests.'=>'Antalet fysiska läsningar av ett nyckelblock från disk. Om värdet Key_reads är stort, då är förmodligen ditt värde key_buffer_size för litet. Cachens missfrekvens kan beräknas som Key_reads/Key_read_requests.','The number of used blocks in the key cache. This value is a high-water mark that indicates the maximum number of blocks that have ever been in use at one time.'=>'Antalet använda block i nyckelcachen. Detta värde är ett högvattenmärke som indikerar maximala antalet block som någonsin använts vid ett tillfälle.','The number of unused blocks in the key cache. You can use this value to determine how much of the key cache is in use.'=>'Antalet oanvända block i nyckelcachen. Du kan använda detta värde för att avgöra hur stor del av nyckelcachen som används.','The number of key blocks in the key cache that have changed but haven\'t yet been flushed to disk. It used to be known as Not_flushed_key_blocks.'=>'Antalet nyckelblock i nyckelcachen som har ändrats men inte ännu överförts till disk. Det brukade vara känt som Not_flushed_key_blocks.','The compiled-in InnoDB page size (default 16KB). Many values are counted in pages; the page size allows them to be easily converted to bytes.'=>'Den inkompilerade InnoDB-sidstorleken (standard 16kB). Många värden räknas i sidor; sidstorleken tillåter dem att enkelt omvandlas till bytes.','The number of waits we had because log buffer was too small and we had to wait for it to be flushed before continuing.'=>'Antalet väntanden pga loggbufferten var för liten och vi behövde vänta på att den skulle rensas innan kunde fortsätta.','The number of pages that have been written for doublewrite operations.'=>'Antalet sidor som har skrivits för doublewrite transaktioner.','Normally, writes to the InnoDB buffer pool happen in the background. However, if it\'s necessary to read or create a page and no clean pages are available, it\'s necessary to wait for pages to be flushed first. This counter counts instances of these waits. If the buffer pool size was set properly, this value should be small.'=>'Normalt sker skrivningar till InnoDB-bufferten i bakgrunden. Dock om det behövs läsas eller skapas en sida och inga rena sidor finns tillgängliga, så är det nödvändigt att vänta på att sidor rensas först. Denna räknare räknar fall med dessa väntanden. Om buffertstorleken var riktigt satt ska detta värde vara litet.','The number of logical reads that InnoDB could not satisfy from buffer pool and had to do a single-page read.'=>'Antalet logiska läsningar som InnoDB inte kunde uppfylla från buffert och fick göra en enkelsidig läsning.','The number of sequential read-aheads InnoDB initiated. This happens when InnoDB does a sequential full table scan.'=>'Antalet sekventiella läsningar i förväg som InnoDB initierat. Detta sker när InnoDB gör en sekventiell avsökning av en hel tabell.','The number of "random" read-aheads InnoDB initiated. This happens when a query is to scan a large portion of a table but in random order.'=>'Antalet "slumpmässiga" läsningar i förväg som InnoDB initierat. Detta sker när en fråga ska avsöka en stor del av en tabell men i slumpmässig ordning.','The number of pages busy because they have been allocated for administrative overhead such as row locks or the adaptive hash index. This value can also be calculated as Innodb_buffer_pool_pages_total - Innodb_buffer_pool_pages_free - Innodb_buffer_pool_pages_data.'=>'Antalet upptagna sidor pga att de har blivit allokerade som administrativt extrautrymme för bl.a. radlås eller adaptivt hashindex. Detta värde kan också beräknas som Innodb_buffer_pool_pages_total - Innodb_buffer_pool_pages_free - Innodb_buffer_pool_pages_data.','The number of latched pages in InnoDB buffer pool. These are pages currently being read or written or that can\'t be flushed or removed for some other reason.'=>'Antalet låsta sidor i InnoDB-buffert. Dessa är sidor som för närvarande läses eller skrivs eller som inte kan rensas eller tas bort av någon annan anledning.','The number of buffer pool pages that have been requested to be flushed.'=>'Antalet buffert-sidor som har efterfrågats om att bli rensade.','The number of requests to read the next row in the data file. This is high if you are doing a lot of table scans. Generally this suggests that your tables are not properly indexed or that your queries are not written to take advantage of the indexes you have.'=>'Antalet efterfrågningar att läsa den följande raden i datafilen. Detta värde är högt om du gör många tabellavsökningar. I allmänhet antyder detta att dina tabeller inte är riktigt indexerade eller att dina frågor inte är skrivna för att dra nytta av de index du har.','The number of requests to read a row based on a fixed position. This is high if you are doing a lot of queries that require sorting of the result. You probably have a lot of queries that require MySQL to scan whole tables or you have joins that don\'t use keys properly.'=>'Antalet efterfrågningar att läsa en rad baserat på en fix position. Detta värde är högt om du ställer många frågor som kräver sortering av resultatet. Du har förmodligen många frågor som kräver att MySQL avsöker hela tabeller eller du har föreningar som inte använder nycklar på rätt sätt.','The number of requests to read the previous row in key order. This read method is mainly used to optimize ORDER BY … DESC.'=>'Antalet efterfrågningar att läsa den föregående raden i nyckelordning. Denna läsmetod används huvudsakligen för att optimera ORDER BY … DESC.','The number of requests to read the next row in key order. This is incremented if you are querying an index column with a range constraint or if you are doing an index scan.'=>'Antalet efterfrågningar att läsa den följande raden i nyckelordning. Detta värde ökas om du frågar en indexkolumn med en urvalsbegränsning eller om du gör en indexavsökning.','The number of requests to read a row based on a key. If this is high, it is a good indication that your queries and tables are properly indexed.'=>'Antalet efterfrågningar att läsa en rad baserat på en nyckel. Om detta värde är högt är det en bra indikation på att dina frågor och tabeller är riktigt indexerade.','The number of times the first entry was read from an index. If this is high, it suggests that the server is doing a lot of full index scans; for example, SELECT col1 FROM foo, assuming that col1 is indexed.'=>'Antalet gånger första posten lästes från ett index. Om detta värde är högt tyder det på att servern gör många helindex-avsökningar; t.ex. SELECT col1 FROM foo, under förutsättning att col1 är indexerad.','The MySQL server can ask the NDB Cluster storage engine if it knows about a table with a given name. This is called discovery. Handler_discover indicates the number of time tables have been discovered.'=>'MySQL-servern kan fråga lagringsmotorn NDB Cluster om den känner till en tabell med ett givet namn. Detta kallas upptäckt. Handler_discover indikerar antalet gånger tabeller har upptäckts.','The number of INSERT DELAYED handler threads in use. Every different table on which one uses INSERT DELAYED gets its own thread.'=>'Antalet INSERT DELAYED-hanteringstrådar i bruk. Varje tabell på vilken man använder INSERT DELAYED får sin egen tråd.','The number of rows written with INSERT DELAYED for which some error occurred (probably duplicate key).'=>'Antalet rader skrivna med INSERT DELAYED för vilka något fel uppstod (förmodligen dubblerad nyckel).','The number of in-memory temporary tables created automatically by the server while executing statements.'=>'Antalet temporära tabeller i minne skapade automatiskt av servern under utförande av satser.','The number of temporary tables on disk created automatically by the server while executing statements. If Created_tmp_disk_tables is big, you may want to increase the tmp_table_size  value to cause temporary tables to be memory-based instead of disk-based.'=>'Antalet temporära tabeller på disk skapade automatiskt av servern under utförande av satser. Om värdet Created_tmp_disk_tables är stort vill du kanske öka värdet tmp_table_size för att åstadkomma att temporära tabeller lagras i minne istället för på disk.','The number of connection attempts (successful or not) to the MySQL server.'=>'Antalet anslutningsförsök (lyckade eller inte) till MySQL-servern.','The number of transactions that used the temporary binary log cache but that exceeded the value of binlog_cache_size and used a temporary file to store statements from the transaction.'=>'Antalet transaktioner som använde den temporära binära loggcachen, men som överskred värdet binlog_cache_size och använde en temporär fil för att lagra satser från transaktionen.','The number of connections that were aborted because the client died without closing the connection properly.'=>'Antalet anslutningar som avbröts eftersom klienten dog utan att stänga anslutningen ordentligt.','Note: phpMyAdmin gets the users’ privileges directly from MySQL’s privilege tables. The content of these tables may differ from the privileges the server uses, if they have been changed manually. In this case, the privileges have to be reloaded but currently, you don\'t have the RELOAD privilege.'=>'Obs: phpMyAdmin hämtar användarnas behörigheter direkt via privilegie-tabellerna i MySQL. Om de har ändrats manuellt, kan innehållet i dessa tabeller skilja sig från de behörigheter servern använder. I så fall behöver behörigheterna laddas om, men du saknar behörighet att utföra RELOAD.','Note: phpMyAdmin gets the users’ privileges directly from MySQL’s privilege tables. The content of these tables may differ from the privileges the server uses, if they have been changed manually. In this case, you should %sreload the privileges%s before you continue.'=>'Obs: phpMyAdmin hämtar användarnas behörigheter direkt via privilegie-tabellerna i MySQL. Om de har ändrats manuellt, kan innehållet i dessa tabeller skilja sig från de behörigheter servern använder. I så fall bör du %srladda om behörigheterna%s innan du fortsätter.','A user account allowing any user from localhost to connect is present. This will prevent other users from connecting if the host part of their account allows a connection from any (%) host.'=>'Det finns ett användarkonto som gör det möjligt för alla användare från localhost att ansluta. Detta förhindrar att andra användare ansluter om serverdelen av deras konto tillåter anslutning från alla (%) IP-adresser.','Converts an Internet network address stored as a binary string into a string in Internet standard (IPv4/IPv6) format.'=>'Konverterar en Internet nätverksadress lagras som en binär sträng till en sträng i Internet standardformat (IPv4/IPv6).','Displays a link; the column contains the filename. The first option is a URL prefix like "https://www.example.com/". The second option is a title for the link.'=>'Visar en länk; kolumnen innehåller filnamn. Det första alternativet är en URL prefix som "https://www.example.com/". Det andra alternativet är en titel för länken.','Image upload functionality which also displays a thumbnail. The options are the width and height of the thumbnail in pixels. Defaults to 100 X 100.'=>'Bild belastar uppladdningsfunktion. Alternativen är bredden och höjden på miniatyren i pixlar. Standard 100X100.','Displays a part of a string. The first option is the number of characters to skip from the beginning of the string (Default 0). The second option is the number of characters to return (Default: until end of string). The third option is the string to append and/or prepend when truncation occurs (Default: "…").'=>'Visar del av en sträng. Första parametern är antalet tecken att hoppa över från början på strängen (standardvärde: 0). Andra parametern är antalet tecken som ska returneras (standardvärde: till slutet på strängen). Den tredje parametern är en sträng som läggs till i slutet och/eller början när trunkering utförs (standardvärde: "…").','Displays a clickable thumbnail. The options are the maximum width and height in pixels. The original aspect ratio is preserved.'=>'Visar en klickbar tumnagelbild. Parametrarna är maximal bredd och höjd i pixlar. Bildens ursprungliga proportioner bibehålls.','Prepends and/or Appends text to a string. First option is text to be prepended, second is appended (enclosed in single quotes, default empty string).'=>'Lägger till text före eller efter en sträng. Det första valet är text att läggas till före strängen, andra valet läggs till efter (inom enkla citattecken, standardvärde är tom sträng).','File upload functionality for TEXT columns. It does not have a textarea for input.'=>'Funktion för uppladdning av filer till TEXT-kolumner. Det finns ingen textarea för inmatning.','Validates the string using regular expression and performs insert only if string matches it. The first option is the Regular Expression.'=>'Validerar strängen med hjälp av reguljära uttryck och infoga endast om strängen matchar det. Det första alternativet är det reguljära uttrycket.','Displays a TIME, TIMESTAMP, DATETIME or numeric unix timestamp column as formatted date. The first option is the offset (in hours) which will be added to the timestamp (Default: 0). Use second option to specify a different date/time format string. Third option determines whether you want to see local date or UTC one (use "local" or "utc" strings) for that. According to that, date format has different value - for "local" see the documentation for PHP\'s strftime() function and for "utc" it is done using gmdate() function.'=>'Visar en TIME, TIMESTAMP, DATETIME eller numerisk unixtidsstämpel som ett formaterat datum. Det första alternativet är förskjutningen (i timmar) som kommer att läggas till tidsstämpeln (Standard: 0). Använd andra alternativet för att ange ett annat datum / tidsformat. Tredje alternativet avgör om du vill se lokalt datum eller UTC (använd strängarna "local" eller "UTC") för det. Enligt detta har datumformat olika värden - för "local" se dokumentationen för PHP:s strftime() och för "UTC" är det gjort med hjälp gmdate()-funktionen.','Displays the contents of the column as-is, without running it through htmlspecialchars(). That is, the column is assumed to contain valid HTML.'=>'Visar innehållet i kolumnen som det är, utan att köra det genom htmlspecialchars(). Det innebär att fältet antas innehålla korrekt HTML-kod.','Displays an image and a link; the column contains the filename. The first option is a URL prefix like "https://www.example.com/". The second and third options are the width and the height in pixels.'=>'Visar en bild och en länk; kolumnen innehåller filnamn. Det första alternativet är ett URL-prefix som "https://www.example.com/". Det andra och tredje alternativet är bredden och höjden i pixlar.','Converts Boolean values to text (default \'T\' and \'F\'). First option is for TRUE, second for FALSE. Nonzero=true.'=>'Konverterar Booleska värden till text (standardvärden \'T\' och \'F\'). Första valet står för SANT, det andra för FALSKT. Nollskilt värde=sant.','Converts an (IPv4) Internet network address stored as a BIGINT into a string in Internet standard dotted format.'=>'Konverterar en (IPv4) Internet nätverksadress lagras som en BIGINT till en sträng i Internet standard decimalform.','Displays a link to download the binary data of the column. You can use the first option to specify the filename, or use the second option as the name of a column which contains the filename. If you use the second option, you need to set the first option to the empty string.'=>'Visar en länk för att ladda ner binära data i kolumnen. Du kan använda det första alternativet för att ange filnamnet eller använda det andra alternativet som namnet på en kolumn som innehåller filnamn. Om du använder det andra alternativet, måste du ställa det första alternativet till den tomma strängen.','Displays hexadecimal representation of data. Optional first parameter specifies how often space will be added (defaults to 2 nibbles).'=>'Visar hexadecimal representation av data. Valfri första parameter anger hur ofta mellanslag läggs till (standardvärde: 2 tecken).','Dump TIMESTAMP columns in UTC <i>(enables TIMESTAMP columns to be dumped and reloaded between servers in different time zones)</i>'=>'Dumpa TIMESTAMP-kolumner i UTC <i>(gör TIMESTAMP-kolumner som ska dumpas och laddas mellan servrar i olika tidszoner)</i>','Dump binary columns in hexadecimal notation <i>(for example, "abc" becomes 0x616263)</i>'=>'Dumpa binära kolumner i hexadecimal notation <i>(t.ex. "abc" blir 0x616263)</i>','neither of the above<br> &nbsp; &nbsp; &nbsp; Example: <code>INSERT INTO tbl_name VALUES (1,2,3)</code>'=>'inget av ovanstående<br> &nbsp; &nbsp; &nbsp; Exempel: <code>INSERT INTO tbl_name VALUES (1,2,3)</code>','both of the above<br> &nbsp; &nbsp; &nbsp; Example: <code>INSERT INTO tbl_name (col_A,col_B,col_C) VALUES (1,2,3), (4,5,6), (7,8,9)</code>'=>'båda av ovanstående<br> &nbsp; &nbsp; &nbsp; Exempel: <code>INSERT INTO tbl_name (col_A,col_B,col_C) VALUES (1,2,3), (4,5,6), (7,8,9)</code>','insert multiple rows in every <code>INSERT</code> statement<br> &nbsp; &nbsp; &nbsp; Example: <code>INSERT INTO tbl_name VALUES (1,2,3), (4,5,6), (7,8,9)</code>'=>'mata in flera rader via varje <code>INSERT</code>-kommando<br> &nbsp; &nbsp; &nbsp; Exempel: <code>INSERT INTO tbl_name VALUES (1,2,3), (4,5,6), (7,8,9)</code>','include column names in every <code>INSERT</code> statement <br> &nbsp; &nbsp; &nbsp; Example: <code>INSERT INTO tbl_name (col_A,col_B,col_C) VALUES (1,2,3)</code>'=>'inkludera kolumnnamn i varje <code>INSERT</code>-kommando <br> &nbsp; &nbsp; &nbsp; Exempel: <code>INSERT INTO tbl_name (col_A,col_B,col_C) VALUES (1,2,3)</code>','Enclose table and column names with backquotes <i>(Protects column and table names formed with special characters or keywords)</i>'=>'Bifoga tabell-och kolumnnamn med backquote (`) <i>(Skyddar kolumn- och tabellnamn skapade med specialtecken eller nyckelord)</i>','(less efficient as indexes will be generated during table creation)'=>'(mindre effektivt eftersom index ska genereras när tabellen skapades)','Database system or older MySQL server to maximize output compatibility with:'=>'Databassystem eller äldre MySQL-server att maximera kompatibilitet av utdata med:','Include a timestamp of when databases were created, last updated, and last checked'=>'Inkludera en tidsstämpel på när databaser skapades, senast uppdaterade, och senast kontrollerade','Display comments <i>(includes info such as export timestamp, PHP version, and server version)</i>'=>'Visa kommentarer <i>(inkluderar info såsom exporttidsstämpel, PHP-version, och serverversion)</i>','phpMyAdmin tried to connect to the MySQL server, and the server rejected the connection. You should check the host, username and password in your configuration and make sure that they correspond to the information given by the administrator of the MySQL server.'=>'phpMyAdmin försökte skapa en förbindelse till MySQL-servern, men servern nekade uppkopplingen. Kontrollera värd, användarnamn och lösenord i din konfiguration och förvissa dig om att de stämmer överens med informationen från administratören av MySQL-servern.','You probably did not create a configuration file. You might want to use the %1$ssetup script%2$s to create one.'=>'Du har troligen inte skapat en konfigurationsfil. Du vill kanske använda %1$suppsättningsskript%2$s för att skapa denna.','Invalid column count in CSV input on line %d.'=>'Ogiltigt antal kolumner i CSV-indata på rad %d.','Invalid column (%s) specified! Ensure that columns names are spelled correctly, separated by commas, and not enclosed in quotes.'=>'Ogiltig kolumn (%s)! Se till att kolumnernas namn är rättstavade, åtskilda med kommatecken och inte omges av citattecken.','If the data in each row of the file is not in the same order as in the database, list the corresponding column names here. Column names must be separated by commas and not enclosed in quotations.'=>'Om uppgifterna i varje rad i filen är inte i samma ordning som i databasen, lista motsvarande kolumnnamn här. Kolumnnamn måste vara åtskilda med kommatecken och inte inneslutna i citattecken.','Update data when duplicate keys found on import (add ON DUPLICATE KEY UPDATE)'=>'Uppdatera data när dublettnyckel hittas vid import (tillägg \'ON DUPLICATE KEY UPDATE\')','The XML file specified was either malformed or incomplete. Please correct the issue and try again.'=>'Den angivna XML-filen var antingen felaktig eller ofullständig. Korrigera problemet och försök igen.','The first line of the file contains the table column names <i>(if this is unchecked, the first line will become part of the data)</i>'=>'Den första raden i filen innehåller tabellens kolumnnamn <i>(om detta inte är markerat, kommer den första raden bli en del av uppgifterna)</i>','Login without a password is forbidden by configuration (see AllowNoPassword)'=>'Inloggning utan lösenord är inte tillåtet enligt konfiguration (se AllowNoPassword)','No routine with name %1$s found in database %2$s. You might be lacking the necessary privileges to edit this routine.'=>'Ingen rutin med namnet %1$s hittades i databasen %2$s. Du kanske saknar nödvändig behörighet för att redigera rutinen.','You must provide length/values for routine parameters of type ENUM, SET, VARCHAR and VARBINARY.'=>'Du måste ange längd/värden för rutinparametrar av typen ENUM, SET, VARCHAR och VARBINARY.','Sorry, we failed to restore the dropped routine.'=>'Tyvärr, vi lyckades inte återställa den slängda rutinen.','Couldn\'t remove Column(s) %1$s as they don\'t exist in central columns list!'=>'Det gick inte att ta bort kolumn/er %1$s eftersom de inte finns i huvudförteckning kolumner!','The configuration storage is not ready for the central list of columns feature.'=>'Konfigurationen lagring är inte redo för den centrala listan över kolumner funktionen.','Linting is disabled for this query because it exceeds the maximum length.'=>'Sökningen överstiger maximal längd, tillägg avstängda.','There is no detailed status information available for this storage engine.'=>'Det finns ingen detaljerad statusinformation tillgänglig för denna lagringsmotor.','Table %1$s has been altered successfully. Privileges have been adjusted.'=>'Tabellen %1$s har ändrats. Privilegierna har justerats.','You have enabled mbstring.func_overload in your PHP configuration. This option is incompatible with phpMyAdmin and might cause some data to be corrupted!'=>'Du har aktiverat mbstring.func_overload i din PHP-konfiguration. Detta alternativ är inkompatibelt med phpMyAdmin och kan leda till att data kan skadas!','The buffer that is allocated when sorting MyISAM indexes during a REPAIR TABLE or when creating indexes with CREATE INDEX or ALTER TABLE.'=>'Bufferten som allokeras vid sortering av MyISAM-index under REPAIR TABLE eller vid skapande av index med CREATE INDEX eller ALTER TABLE.','If this value is greater than 1, MyISAM table indexes are created in parallel (each index in its own thread) during the repair by sorting process.'=>'Om detta värde är större än 1 skapas MyISAM-tabellindex parallellt (varje index i sin egen tråd) under reparationen vid sorteringsprocess.','If the temporary file used for fast MyISAM index creation would be larger than using the key cache by the amount specified here, prefer the key cache method.'=>'Om den temporära filen som används för snabbt skapande av MyISAM-index skulle vara större än att använda nyckelcachen vars storlek specificeras här, så föredras metoden med nyckelcachen.','The maximum size of the temporary file MySQL is allowed to use while re-creating a MyISAM index (during REPAIR TABLE, ALTER TABLE, or LOAD DATA INFILE).'=>'Denna maximala storleken för den temporära filen som MySQL är tillåten att använda under återskapande av MyISAM-index (vid REPAIR TABLE, ALTER TABLE, eller LOAD DATA INFILE).','The mode for automatic recovery of crashed MyISAM tables, as set via the --myisam-recover server startup option.'=>'Inställningen för automatisk återställning av kraschade MyISAM-tabeller, som satts via serverns startparameter --myisam-recover.','The default pointer size in bytes, to be used by CREATE TABLE for MyISAM tables when no MAX_ROWS option is specified.'=>'Standardpekarens storlek i bytes, vilken används av CREATE TABLE för MyISAM-tabeller när inget MAX_ROWS-alternativ är specificerat.','Documentation and further information about PBXT can be found on the %sPrimeBase XT Home Page%s.'=>'Dokumentation och ytterligare information finns på %sPrimeBase XT Home Page%s.','This is the number of transaction log files (pbxt/system/xlog*.xt) the system will maintain. If the number of logs exceeds this value then old logs will be deleted, otherwise they are renamed and given the next highest number.'=>'Detta är antalet transaktionsloggfiler (pbxt/system/xlog*.xt) som systemet upprätthåller. Om antalet loggar överstiger detta värde tas gamla loggar bort. Annars döps de om och ges det näst högsta numret.','The size of the buffer used when writing a data log. The default is 256MB. The engine allocates one buffer per thread, but only if the thread is required to write a data log.'=>'Storleken på använd buffer vid skrivning av datalogg. Standardvärdet är 256MB. Motorn allokerar en buffer per tråd, men endast om tråden behöver skriva en datalogg.','The percentage of garbage in a data log file before it is compacted. This is a value between 1 and 99. The default is 50.'=>'Andelen skräp i en dataloggfil innan den komprimeras. Detta är ett värde mellan 1 och 99. Standardvärdet är 50.','The maximum size of a data log file. The default value is 64MB. PBXT can create a maximum of 32000 data logs, which are used by all tables. So the value of this variable can be increased to increase the total amount of data that can be stored in the database.'=>'Maximal storlek för dataloggfil. Standardvärdet är 64MB. PBXT kan skapa maximalt 32000 dataloggar, som används av alla tabeller. Så denna variabels värde kan ökas för att öka den totala mängden data som kan lagras i databasen.','The amount of data written to the transaction log before a checkpoint is performed. The default value is 24MB.'=>'Mängden data som skrivs till transaktionsloggen innan en kontrollpunkt utförs. Standardvärdet är 24MB.','The size of the global transaction log buffer (the engine allocates 2 buffers of this size). The default is 1MB.'=>'Storleken på den globala transaktionsloggbuffern (motorn allokerar 2 buffrar med denna storlek). Standardvärdet är 1MB.','The size of a transaction log before rollover, and a new log is created. The default value is 16MB.'=>'Storleken på en transaktionslogg före övergång då en ny logg skapas. Standardvärdet är 16MB.','The amount of memory allocated to the transaction log cache used to cache on transaction log data. The default is 16MB.'=>'Mängden minne som allokeras för transaktionsloggcachen som används för cache av transaktionsloggdata. Standardvärdet är 16MB.','This is the amount of memory allocated to the record cache used to cache table data. The default value is 32MB. This memory is used to cache changes to the handle data (.xtd) and row pointer (.xtr) files.'=>'Detta är mängden minne som allokeras för radcachen som används för cache av tabelldata. Standardvärdet är 32MB. Detta minne används för att cacha ändringar i filer för hanteringsdata (.xtd) och radpekare (.xtr).','This is the amount of memory allocated to the index cache. Default value is 32MB. The memory allocated here is used only for caching index pages.'=>'Detta är mängden minne som allokeras för indexcachen. Standardvärdet är 32MB. Minnet som allokeras här används endast för cache av indexsidor.','The size of the memory buffer InnoDB uses to cache data and indexes of its tables.'=>'Storleken på minnesbufferten som InnoDB använder för cache av data och index till sina tabeller.','The increment size for extending the size of an autoextending tablespace when it becomes full.'=>'Tillökningsstorleken vid automatisk utökning av tabellutrymme när det blir fullt.','The common part of the directory path for all InnoDB data files.'=>'Den gemensamma delen av sökvägen för alla InnoDB-datafiler.','The indexes %1$s and %2$s seem to be equal and one of them could possibly be removed.'=>'Index %1$s och %2$s verkar vara identiska och ett av dem kan möjligen tas bort.','You do not have necessary privileges to create a database named \'%s\'. You may go to \'Operations\' tab of any database to set up the phpMyAdmin configuration storage there.'=>'Du har inte nödvändiga privilegier för att skapa en databas med namnet \'%s\'. Du kan gå till fliken \'Operations\' i vilken databas som helst för att ställa in phpMyAdmin-konfigurationslagringen där.','Table %s has been copied to %s. Privileges have been adjusted.'=>'Registret %s har kopierats till %s., privilegier har justerats.','Table %s has been moved to %s. Privileges have been adjusted.'=>'Registret %s har flyttats till %s., privilegier har justerats.','Error creating foreign key on %1$s (check data types)'=>'Fel vid skapande av främmande nyckel för %1$s (kontrollera datatyper)','Cannot save UI property "%s". The changes made will not be persistent after you refresh this page. Please check if the table structure has been changed.'=>'Kan inte spara gränssnittsattribut "%s". Ändringarna kommer inte vara beständiga efter att du uppdaterar denna sida. Kontrollera om tabellens struktur har förändrats.','Failed to cleanup table UI preferences (see $cfg[\'Servers\'][$i][\'MaxTableUiprefs\'] %s)'=>'Misslyckades med att rensa gränssnittsinställningar för tabell (se $cfg[\'Servers\'][$i][\'MaxTableUiprefs\'] %s)','Connection for controluser as defined in your configuration failed.'=>'Uppkoppling för kontrollanvändare enligt din konfiguration misslyckades.','The server is not responding (or the local server\'s socket is not correctly configured).'=>'Servern svarar inte (eller den lokala serverns socket är inte korrekt konfigurerad).','Unable to use timezone "%1$s" for server %2$d. Please check your configuration setting for [em]$cfg[\'Servers\'][%3$d][\'SessionTimeZone\'][/em]. phpMyAdmin is currently using the default time zone of the database server.'=>'Det går inte att använda tidszonen "%1$s" för servern %2$d. Kontrollera inställningen för [em]$cfg[\'Servers\'][%3$d][\'SessionTimeZone\'][/em]. phpMyAdmin använder för närvarande databasserverns standardtidszon.','This list is based on a subset of the table\'s data and is not necessarily accurate. '=>'Denna lista är baserad på en delmängd av tabellens data och är inte nödvändigtvis korrekt. ','Hint: Please follow the procedure carefully in order to obtain correct normalization'=>'Tips: Följ anvisningar noga för att få rätt normalisering','No Transitive dependencies possible as the table doesn\'t have any non primary key columns'=>'Inga transitiva beroenden möjliga, eftersom tabellen inte har någon icke primära nyckelkolumner','For each column below, please select the <b>minimal set</b> of columns among given set whose values combined together are sufficient to determine the value of the column.<br>Note: A column may have no transitive dependency, in that case you don\'t have to select any.'=>'För varje kolumn nedan, Välj <b>minimal uppsättning</b> kolumner av givna värden, vars kombinerade värden är tillräckliga för att fastställa kolumnens värde. <br> Obs: om någon kolumn inte har transitiva beroenden behöver du inte välja någon kolumn alls.','In order to put the original table \'%1$s\' into Third normal form we need to create the following tables:'=>'För att ändra den ursprungliga tabellen %1$s\' till tredje normalformen måste vi skapa följande tabeller:','In order to put the original table \'%1$s\' into Second normal form we need to create the following tables:'=>'För ändra den ursprungliga tabellen %1$s\' till andra normalformen måste vi skapa följande tabeller:','No partial dependencies possible as the primary key ( %1$s ) has just one column.'=>'Ingen partiell beroenden möjligt eftersom primärnyckel (%1$s) bara har en kolumn.','For each column below, please select the <b>minimal set</b> of columns among given set whose values combined together are sufficient to determine the value of the column.'=>'För varje kolumn nedan, Välj <b>minimal uppsättning</b> kolumner bland de givna värden som kombinerade är tillräckliga för att fastställa totalvärdet för kolumnen.','+ Show me the possible partial dependencies based on data in the table'=>'+ Visa mig den möjliga partiella beroenden baserat på data i tabellen','Please answer the following question(s) carefully to obtain a correct normalization.'=>'Vänligen svara på följande frågan/frågorna noggrant för att få en korrekt normalisering.','The primary key ( %1$s ) consists of more than one column so we need to find the partial dependencies.'=>'Primärnyckeln (%1$s) består av mer än en kolumn så vi måste hitta de partiella beroendena.','No partial dependencies possible as no non-primary column exists since primary key ( %1$s ) is composed of all the columns in the table.'=>'Inga delvisa beroenden möjliga eftersom ingen icke-primära kolumnen finns eftersom primärnyckeln (%1$s) består av alla kolumner i tabellen.','Check the columns which form a repeating group. If no such group, click on \'No repeating group\''=>'Markera kolumnerna som utgör en upprepande grupp. Om ingen sådan grupp, klickar du på "Inget upprepande grupp"','Do you have a group of two or more columns that are closely related and are all repeating the same attribute? For example, a table that holds data on books might have columns such as book_id, author1, author2, author3 and so on which form a repeating group. In this case a new table (book_id, author) should be created.'=>'Har du en grupp av två eller flera kolumner som är närbesläktade och alla upprepar samma attribut? Till exempel kan en tabell som innehåller data om böcker ha kolumner som book_id, author1, Författare2, author3 och så vidare som bildar en upprepande grupp. I detta fall skapas en ny tabell (book_id, författare).','Check the columns which are redundant and click on remove. If no redundant column, click on \'No redundant column\''=>'Markera de kolumner som är överflödiga och klicka på ta bort. Annars klickar du på "Ingen överflödig kolumn"','Do you have a group of columns which on combining gives an existing column? For example, if you have first_name, last_name and full_name then combining first_name and last_name gives full_name which is redundant.'=>'Har du en grupp med kolumner som kombinerade ger en befintlig kolumn? Till exempel om du har förnamn/efternamn/full_name, så är full_namn överflödigt.','If it\'s not possible to make existing column combinations as primary key'=>'Om det inte är möjligt att göra kolumnkombinationer till primärnyckel','There is no primary key; please add one.<br>Hint: A primary key is a column (or combination of columns) that uniquely identify all rows.'=>'Det finns ingen primär nyckel; Lägg till en. <br> Tips: En primär nyckel är en kolumn (eller kombination av kolumner) som unikt identifierar alla rader.','Select a column which can be split into more than one (on select of \'no such column\', it\'ll move to next step).'=>'Välj en kolumn som kan delas upp i mer än en (om du väljer ”ingen sådan kolumn” går rutinen vidare till nästa steg).','Do you have any column which can be split into more than one column? For example: address can be split into street, city, country and zip.'=>'Har du någon kolumn som kan delas upp i mer än en kolumn? Till exempel: adress kan delas in i gata, stad, land och postnummer.','Stores and enables efficient access to data in JSON (JavaScript Object Notation) documents'=>'Lagrar och möjliggör effektiv åtkomst till data i JSON (JavaScript Object Notation) -dokument','An enumeration, chosen from the list of up to 65,535 values or the special \'\' error value'=>'En uppräkning, vald från listan med upp till 65.535 värden eller det speciella felvärdet \'\'','A BLOB column with a maximum length of 4,294,967,295 or 4GiB (2^32 - 1) bytes, stored with a four-byte prefix indicating the length of the value'=>'En BLOB-kolumn med en maximal längd av 4,294,967,295 och 4GB (2^32-1) byte, lagrad med ett fyra-bytes prefix som anger längden på värdet','A BLOB column with a maximum length of 65,535 (2^16 - 1) bytes, stored with a two-byte prefix indicating the length of the value'=>'En BLOB-kolumn med en maximal längd av 65.535 (2^16-1) bytes, lagrad med ett två bytes prefix vilket anger längden på värdet','A BLOB column with a maximum length of 16,777,215 (2^24 - 1) bytes, stored with a three-byte prefix indicating the length of the value'=>'En BLOB-kolumn med en maximal längd av 16.777.215 (2^24-1) bytes, lagrat med ett tre-bytes prefix vilket anger längden av värdet','A BLOB column with a maximum length of 255 (2^8 - 1) bytes, stored with a one-byte prefix indicating the length of the value'=>'En BLOB-kolumn med en maximal längd av 255 (2^8-1) bytes, lagrat med ett en-bytes prefix vilket anger längden av värdet','Similar to the VARCHAR type, but stores binary byte strings rather than non-binary character strings'=>'Liknande typen VARCHAR, men lagrar binära bytesträngar snarare än icke-binära teckensträngar','Similar to the CHAR type, but stores binary byte strings rather than non-binary character strings'=>'Liknande typen CHAR, men lagrar binära bytesträngar snarare än icke-binära teckensträngar','A TEXT column with a maximum length of 4,294,967,295 or 4GiB (2^32 - 1) characters, stored with a four-byte prefix indicating the length of the value in bytes'=>'En TEXT-kolumn med en maximal längd av 4,294,967,295 eller 4GB (2^32-1) tecken, lagrat med ett fyra-bytes prefix vilket anger längden av värdet i bytes','A TEXT column with a maximum length of 16,777,215 (2^24 - 1) characters, stored with a three-byte prefix indicating the length of the value in bytes'=>'En TEXT-kolumn med en maximal längd av 16.777.215 (2^24-1) tecken, lagrat med ett tre-bytes prefix vilket anger längden av värdet i bytes','A TEXT column with a maximum length of 65,535 (2^16 - 1) characters, stored with a two-byte prefix indicating the length of the value in bytes'=>'En TEXT-kolumn med en maximal längd av 65.535 (2^16-1) tecken, lagrat med ett två-bytes prefix vilket anger längden av värdet i bytes','A TEXT column with a maximum length of 255 (2^8 - 1) characters, stored with a one-byte prefix indicating the length of the value in bytes'=>'En TEXT-kolumn med en maximal längd av 255 (2^8-1) tecken, lagrat med ett en-bytes prefix vilket anger längden av värdet i bytes','A variable-length (%s) string, the effective maximum length is subject to the maximum row size'=>'En variabel-längd (%s) sträng, den effektiva maximala längden är förutsättningen för den maximala radstorleken','A fixed-length (0-255, default 1) string that is always right-padded with spaces to the specified length when stored'=>'En sträng med fast längd (0-255, standard 1) som alltid är högerfylld med blankslag till den angivna längden vid lagring','A year in four-digit (4, default) or two-digit (2) format, the allowable values are 70 (1970) to 69 (2069) or 1901 to 2155 and 0000'=>'Ett år i fyr-siffrigt (4, default) eller 2-siffrigt (2) format, tillåtna värden är: 70 (1970) till 69 (2069) eller 1901 till 2155 och 0000','A timestamp, range is 1970-01-01 00:00:01 UTC to 2038-01-09 03:14:07 UTC, stored as the number of seconds since the epoch (1970-01-01 00:00:00 UTC)'=>'En tidsstämpel, intervallet är 1970-01-01 00:00:01 UTC till 2038-01-09 03:14:07 UTC, lagrad som antalet sekunder sedan 1970-01-01 00:00:00 UTC','A synonym for TINYINT(1), a value of zero is considered false, nonzero values are considered true'=>'En synonym för TINYINT (1), ett värde på noll betraktas som falskt, värden skilda från noll anses sanna','A bit-field type (M), storing M of bits per value (default is 1, maximum is 64)'=>'En bit-fälttyp (M), lagrar M bitar per värde default är 1, maximalt är 64)','Synonym for DOUBLE (exception: in REAL_AS_FLOAT SQL mode it is a synonym for FLOAT)'=>'Synonym för DOUBLE (undantag: i REAL_AS_FLOAT SQL läget är det en synonym för FLOAT)','A double-precision floating-point number, allowable values are -1.7976931348623157E+308 to -2.2250738585072014E-308, 0, and 2.2250738585072014E-308 to 1.7976931348623157E+308'=>'Ett dubbel-precision flyttal. Tillåtna värden är: 1.7976931348623157E+308 till 2.2250738585072014E-308, 0, och 2.2250738585072014E-308 till 1.7976931348623157E+308','A small floating-point number, allowable values are -3.402823466E+38 to -1.175494351E-38, 0, and 1.175494351E-38 to 3.402823466E+38'=>'Ett litet flyttal. Tillåtna värden är: 3.402823466E+38 till-1.175494351E-38, 0, och 1.175494351E-38 till 3.402823466E+38','A fixed-point number (M, D) - the maximum number of digits (M) is 65 (default 10), the maximum number of decimals (D) is 30 (default 0)'=>'Ett fast-punkt nummer (M, D) - det maximala antalet siffror (M) är 65 (default 10), det maximala antalet decimaler (D) är 30 (default 0)','An 8-byte integer, signed range is -9,223,372,036,854,775,808 to 9,223,372,036,854,775,807, unsigned range is 0 to 18,446,744,073,709,551,615'=>'Ett 8-bytes heltal, signerat inom intervallet -9.223.372.036.854.775.808 till 9.223.372.036.854.775.807, osignerat inom intervallet 0 till 18.446.744.073.709.551.615','A 4-byte integer, signed range is -2,147,483,648 to 2,147,483,647, unsigned range is 0 to 4,294,967,295'=>'Ett 4-bytes heltal, signerat inom intervallet -2147483648 till 2147483647, osignerat inom intervallet 0 till 4294967295','A 3-byte integer, signed range is -8,388,608 to 8,388,607, unsigned range is 0 to 16,777,215'=>'Ett 3-bytes heltal, signerat inom intervallet -8.388.608 till 8.388.607, osignerat inom intervallet 0 till 16.777.215','A 2-byte integer, signed range is -32,768 to 32,767, unsigned range is 0 to 65,535'=>'Ett 2-bytes heltal, signerat inom intervallet -32.768 till 32.767, osignerat inom intervallet 0 till 65.535','A 1-byte integer, signed range is -128 to 127, unsigned range is 0 to 255'=>'En 1-byte heltal, signerat intervall är -128 till 127, osignerad intervall är 0 till 255','%1$sGZip compression and decompression%2$s requires functions (%3$s) which are unavailable on this system.'=>'%1$sKomprimeringen och uppackningen Gzip%2$s kräver funktioner (%3$s) som inte är tillgängliga på detta system.','%1$sBzip2 compression and decompression%2$s requires functions (%3$s) which are unavailable on this system.'=>'%1$sKomprimeringen och uppackningen Bzip2%2$s kräver funktioner (%3$s) som inte är tillgängliga på detta system.','If using [kbd]cookie[/kbd] authentication and %sLogin cookie store%s is not 0, %sLogin cookie validity%s must be set to a value less or equal to it.'=>'Om du använder [kbd]cookie[/kbd] -autentisering och %sLogin cookie store%s inte är 0, måste %sLogin cookie validity%s sättas till ett värde mindre eller lika med den.','%sLogin cookie validity%s should be set to 1800 seconds (30 minutes) at most. Values larger than 1800 may pose a security risk such as impersonation.'=>'%slogin cookie giltighet%s ska anges till 1800 sekunder (30 minuter) som mest. Värden större än 1800 kan innebära en säkerhetsrisk som identitetsstöld.','%1$sLogin cookie validity%2$s greater than %3$ssession.gc_maxlifetime%4$s may cause random session invalidation (currently session.gc_maxlifetime is %5$d).'=>'Längre %1$sgiltighetstid för inloggnings-cookie%2$s än %3$ssession.gc_maxlifetime%4$s kan leda till att sessioner slumpmässigt blir ogiltiga (för närvarande har session.gc_maxlifetime värdet %5$d).','You didn\'t have blowfish secret set and have enabled [kbd]cookie[/kbd] authentication, so a key was automatically generated for you. It is used to encrypt cookies; you don\'t need to remember it.'=>'Du hade inte blowfish-säkerhet angivet och hade aktiverat [kbd]cookie[/kbd]-autentisering, så en nyckel genererades automatiskt åt dig. Den används för att kryptera cookies; du behöver inte komma ihåg den.','%sZip compression%s requires functions (%s) which are unavailable on this system.'=>'%sZip kompression%s kräver funktioner (%s) som inte är tillgängliga på detta system.','%sZip decompression%s requires functions (%s) which are unavailable on this system.'=>'%sZip dekompression%s kräver funktioner (%s) som inte är tillgängliga på detta system.','You set the [kbd]config[/kbd] authentication type and included username and password for auto-login, which is not a desirable option for live hosts. Anyone who knows or guesses your phpMyAdmin URL can directly access your phpMyAdmin panel. Set %1$sauthentication type%2$s to [kbd]cookie[/kbd] or [kbd]http[/kbd].'=>'Du har angett autentiseringstypen [kbd]config[/kbd] och inkluderat användarnamn och lösenord för automatisk inloggning, något som inte är önskvärt för servrar i publik drift. Vem som helst, som känner till eller kan gissa sig till din URL för phpMyAdmin kan direkt nå din adminpanel i phpMyAdmin. Ställ in Set %1$sautentiseringstypen%2$s till [kbd]cookie[/kbd] eller [kbd]http[/kbd].','You should use SSL connections if your database server supports it.'=>'Du ska använda SSL-anslutning om din databasserver stödjer det.','This value should be double checked to ensure that this directory is neither world accessible nor readable or writable by other users on your server.'=>'Detta värde bör dubbelkollas för att försäkra att denna katalog varken är åtkomlig för världen eller skrivbar för andra användare på din server.','This %soption%s should be disabled as it allows attackers to bruteforce login to any MySQL server. If you feel this is necessary, use %srestrict login to MySQL server%s or %strusted proxies list%s. However, IP-based protection with trusted proxies list may not be reliable if your IP belongs to an ISP where thousands of users, including you, are connected to.'=>'Denna %soption%s ska inaktiveras eftersom det gör att angripare kan "tvångsinlogga" till MySQL server. Om du känner att detta är nödvändigt, Använd %srestrict login tp MySQL server%s eller %strusted proxies list%s. IP-baserade skydd med betrodda fullmakter kanske inte tillförlitlig om din IP tillhör en ISP där tusentals användare är anslutna.','Empty phpMyAdmin control user password while using phpMyAdmin configuration storage!'=>'Tomt lösenord för phpMyAdmin-kontrollanvändare vid användning av konfigurationslagring för phpMyAdmin!','Empty phpMyAdmin control user while using phpMyAdmin configuration storage!'=>'Tom phpMyAdmin-kontrollanvändare vid användning av konfigurationslagring för phpMyAdmin!','Empty signon URL while using [kbd]signon[/kbd] authentication method!'=>'Tom URL för signon vid användning av [kbd]signon[/kbd]-autentisering!','Empty signon session name while using [kbd]signon[/kbd] authentication method!'=>'Tomt sessionsnamn för signon vid användning av [kbd]signon[/kbd]-autentisering!','Cannot save settings, submitted configuration form contains errors!'=>'Kan inte spara inställningar, sänt konfigurationsformulär innehåller fel!','Queries are executed by pressing Enter (instead of Ctrl+Enter). New lines will be inserted with Shift+Enter.'=>'Sökningar utförs genom att trycka på RETUR (i stället för Ctrl+Retur). Nya rader infogas med SKIFT+RETUR.','The username for authenticating with the proxy. By default, no authentication is performed. If a username is supplied, Basic Authentication will be performed. No other types of authentication are currently supported.'=>'Användarnamnet för autentisering med proxy. Standard är ingen autentisering. Om ett användarnamn anges kommer grundläggande autentisering ske. Inga andra typer av autentisering stöds för närvarande.','When disabled, users cannot set any of the options below, regardless of the checkbox on the right.'=>'När det är avstängt, kan användare inte ange något av alternativen nedan, oberoende av kryssrutan till höger.','Input proxies as [kbd]IP: trusted HTTP header[/kbd]. The following example specifies that phpMyAdmin should trust a HTTP_X_FORWARDED_FOR (X-Forwarded-For) header coming from the proxy 1.2.3.4:[br][kbd]1.2.3.4: HTTP_X_FORWARDED_FOR[/kbd].'=>'Ange proxy som [kbd]IP: trusted HTTP header[/kbd]. I följande exempel anges att phpMyAdmin bör lita på ett HTTP_X_FORWARDED_FOR (X-Forwarded-For)-huvud som kommer från proxyservern 1.2.3.4:[br][kbd]1.2.3.4: HTTP_X_FORWARDED_FOR[/kbd].','Textarea size (rows) in edit mode, this value will be emphasized for SQL query textareas (*2).'=>'Textareans storlek (rader) i redigeringsläge, detta värde kommer betonas för SQL-frågetextfält (* 2).','Textarea size (columns) in edit mode, this value will be emphasized for SQL query textareas (*2).'=>'Textareans storlek (kolumner) i redigeringsläge, detta värde kommer betonas för SQL-frågetextfält (* 2).','Disable the default warning that is displayed on the main page if the value of the PHP setting session.gc_maxlifetime is less than the value of `LoginCookieValidity`.'=>'Inaktivera standard varningen som visas på huvudsidan om värdet av PHP inställningen session.gc_maxlifetime är mindre än värdet för \'LoginCookieValidity\'.','Disable the default warning that is displayed on the main page if Suhosin is detected.'=>'Stäng av varning om att Suhosin upptäcks.','Shows link to [a@https://www.php.net/manual/en/function.phpinfo.php]phpinfo()[/a] output.'=>'Visar länk till [a@https://www.php.net/manual/en/function.phpinfo.php]phpinfo()[/a] output.','Defines whether or not type fields should be initially displayed in edit/insert mode.'=>'Anger om typ-fält först bör visas i ändra/infoga-läge.','Please note that enabling this has no effect with [kbd]config[/kbd] authentication mode because the password is hard coded in the configuration file; this does not limit the ability to execute the same command directly.'=>'Observera att aktivering av detta har ingen inverkan på [kbd]config[/kbd]-autentisering eftersom lösenordet är hårdkodat i konfigurationsfilen; detta begränsar inte möjligheten att utföra samma kommando direkt.','A user-friendly description of this server. Leave blank to display the hostname instead.'=>'En användarvänlig beskrivning av denna server. Lämna tomt för att visa värdnamnet istället.','Leave blank to disable the feature to hide and show navigation items, suggested: [kbd]pma__navigationhiding[/kbd].'=>'Lämna tomt för att stänga av funktionen att dölja och visa navigationsobjekt, förslag: [kbd]pma__navigationhiding[/kbd].','Both this table and the users table are required to enable the configurable menus feature; leaving either one of them blank will disable this feature, suggested: [kbd]pma__usergroups[/kbd].'=>'Både denna tabell och användartabellen behövs för att aktivera funktionen anpassningsbara menyer; om en av dem lämnas tom inaktiveras funktionen, förslag: [kbd]pma__usergroups[/kbd].','Both this table and the user groups table are required to enable the configurable menus feature; leaving either one of them blank will disable this feature, suggested: [kbd]pma__users[/kbd].'=>'Både denna tabell och användargruppstabellen behövs för att aktivera funktionen anpassningsbara menyer; om en av dem lämnas tom inaktiveras funktionen, förslag: [kbd]pma__users[/kbd].','Leave blank for no user preferences storage in database, suggested: [kbd]pma__userconfig[/kbd].'=>'Lämna tomt för att stänga av lagring av användarpreferenser i databasen, förslag: [kbd]pma__userconfig[/kbd].','Whether the tracking mechanism creates versions for tables and views automatically.'=>'Huruvida spårningsmekanismen skapar versioner för tabeller och vyer automatiskt.','Leave blank for no SQL query tracking support, suggested: [kbd]pma__tracking[/kbd].'=>'Lämna tomt för avstängt stöd för SQL-frågespårning, förslag: [kbd]pma__tracking[/kbd].','Whether a DROP VIEW IF EXISTS statement will be added as first line to the log when creating a view.'=>'Om DROP VIEW IF EXISTS-kommando skall läggas till som första raden i loggen när man skapar en vy.','Whether a DROP TABLE IF EXISTS statement will be added as first line to the log when creating a table.'=>'Om DROP TABLE IF EXISTS-kommando skall läggas till som första raden i loggen när man skapar en tabell.','Whether a DROP DATABASE IF EXISTS statement will be added as first line to the log when creating a database.'=>'Om DROP DATABASE IF EXISTS-kommando skall läggas till som första raden i loggen när man skapar en databas.','Leave blank for no "persistent" tables\' UI preferences across sessions, suggested: [kbd]pma__table_uiprefs[/kbd].'=>'Lämna tomt för att stänga av "ihållande" tabellers användargränssnittspreferenser som sparas över sessioner, förslag: [kbd]pma__table_uiprefs[/kbd].','Table to describe the display columns, leave blank for no support; suggested: [kbd]pma__table_info[/kbd].'=>'Tabell för att beskriva visningskolumnerna, lämna tomt för avstängt stöd; förslag: [kbd]pma__table_info[/kbd].','See [doc@authentication-modes]authentication types[/doc] for an example.'=>'Se [doc@authentication-modes]autentiseringstyper[/doc] för ett exempel.','Leave blank for no [doc@relations@]relation-links[/doc] support, suggested: [kbd]pma__relation[/kbd].'=>'Lämna tomt för avstängt stöd för [doc@relations@]relationslänkar[/doc], förslag: [kbd]pma__relation[/kbd].','Leave blank for no "persistent" favorite tables across sessions, suggested: [kbd]pma__favorite[/kbd].'=>'Lämna tom för inga favorittabeller över sessioner, förslag: [kbd] pma__favorite [/kbd].','Leave blank for no "persistent" recently used tables across sessions, suggested: [kbd]pma__recent[/kbd].'=>'Lämna tomt för att stänga av "ihållande" nyligen använda tabeller över sessioner, förslag: [kbd]pma__recent[/kbd].','Database used for relations, bookmarks, and PDF features. See [doc@linked-tables]pmadb[/doc] for complete information. Leave blank for no support. Suggested: [kbd]phpmyadmin[/kbd].'=>'Databas som används för relationer, bokmärken och PDF-funktioner. Se [doc@linked-tables]pmadb[/doc] för komplett information. Lämna tomt för inget stöd. Förslag: [kbd]phpmyadmin[/kbd].','You can use MySQL wildcard characters (% and _), escape them if you want to use their literal instances, i.e. use [kbd]\'my\\_db\'[/kbd] and not [kbd]\'my_db\'[/kbd].'=>'Du kan använda MySQL:s jokertecken (% och _), sätt \\ före dem om du vill använda deras ordagranna betydelse, dvs använd [kbd] \'my\\_db"[/kbd] och inte [kbd]\'my_db"[/kbd].','Leave blank for no central columns support, suggested: [kbd]pma__central_columns[/kbd].'=>'Lämn tom för inget huvudkolumnstöd, förslag: [kbd] pma__central_columns [/kbd].','Leave blank for no export template support, suggested: [kbd]pma__export_templates[/kbd].'=>'Lämna tom för inget stöd vid vapenexport, förslag: [kbd] pma__export_templates [/kbd].','Leave blank for no QBE saved searches support, suggested: [kbd]pma__savedsearches[/kbd].'=>'Lämna tomt för inget stöd vid QBE-sökningar, förslag: [kbd] pma__savedsearches [/kbd].','Limits number of table preferences which are stored in database, the oldest records are automatically removed.'=>'Begränsar antalet tabellpreferenser som lagras i databasen, de äldsta posterna tas bort automatiskt.','Leave blank for no SQL query history support, suggested: [kbd]pma__history[/kbd].'=>'Lämna blankt för att stänga av stöd för SQL-frågehistorik, förslag: [kbd]pma__history[/kbd].','More information on [a@https://github.com/phpmyadmin/phpmyadmin/issues/8970]phpMyAdmin issue tracker[/a] and [a@https://bugs.mysql.com/19588]MySQL Bugs[/a]'=>'Mer information om [a@https://github.com/phpmyadmin/phpmyadmin/issues/8970] phpMyAdmin problemlista[/a] och [a@https://bugs.mysql.com/19588] Fel i MySQL[/a]','An alternate port to connect to the host that holds the configuration storage; leave blank to use the default port, or the already defined port, if the controlhost equals host.'=>'En alternativ port för att ansluta till värden som tillhandahåller konfigurationslagring; lämna tomt för att använda standardporten, eller den redan definierade porten, om controlhost motsvarar host.','An alternate host to hold the configuration storage; leave blank to use the already defined host.'=>'En alternativ värd för att hålla konfigurationslagring, lämna tomt för att använda den aktuella värden.','A special MySQL user configured with limited permissions, more information available on [doc@linked-tables]documentation[/doc].'=>'En speciell MySQL-användare konfigurerad med begränsade rättigheter, mer information tillgänglig i [doc@linked-tables]dokumentationen[/doc].','Leave blank for no column comments/media types, suggested: [kbd]pma__column_info[/kbd].'=>'Lämna tomt för att stänga av kolumnkommentarer/mediatyper, förslag: [kbd]pma__column_info[/kbd].','Leave blank for no [doc@bookmarks@]bookmark[/doc] support, suggested: [kbd]pma__bookmark[/kbd]'=>'Lämna tomt för att stänga av [doc@bookmarks@]bokmärken[/doc], förslag: [kbd]pma_bookmark[/kbd]','Sets the effective timezone; possibly different than the one from your database server'=>'Ställer in aktuell tidszon; möjligen annorlunda än den från din databasserver','Enable if you want DB-based query history (requires phpMyAdmin configuration storage). If disabled, this utilizes JS-routines to display query history (lost by window close).'=>'Aktivera om du vill ha DB-baserad frågehistorik (kräver phpMyAdmin konfigurationslagring). Om inakiverad, så används JS-rutiner för att visa frågehistorik (förloras när fönstret stängs).','Disable the default warning that is displayed on the Structure page if column names in a table are reserved MySQL words.'=>'Inaktivera standardvarningen som visas på sidan Struktur om kolumnnamn i en tabell är reserverade MySQL-ord.','Disable the default warning that is displayed on the database details Structure page if any of the required tables for the phpMyAdmin configuration storage could not be found.'=>'Inaktivera standardvarningar som visas på struktursidan under databasdetaljer om någon av de nödvändiga tabellerna för konfigurationslagring för phpMyAdmin inte kunde hittas.','[kbd]SMART[/kbd] - i.e. descending order for columns of type TIME, DATE, DATETIME and TIMESTAMP, ascending order otherwise.'=>'[kbd]SMART[/kbd] - dvs fallande ordning för kolumner av typen TIME, DATE, DATETIME och TIMESTAMP, stigande ordning annars.','Group items in the navigation tree (determined by the separator defined in the Databases and Tables tabs above).'=>'Grupperar objekt i navigationsträdet (bestäms av avskiljaren definierad i databas- & tabell-flikarna).','Defines the minimum number of items (tables, views, routines and events) to display a filter box.'=>'Definierar minsta antal objekt (tabeller, vyer, rutiner och händelser) för att visa en filterbox.','Number of rows displayed when browsing a result set. If the result set contains more rows, "Previous" and "Next" links will be shown.'=>'Antal rader som visas vid visning av resultat. Om resultatet innehåller fler rader, visas länkar för "Föregående" och "Nästa".','The number of items that can be displayed on each page on the first level of the navigation tree.'=>'Antalet objekt som kan visas på varje sida på den första nivån av navigationsträdet.','Defines how long (in seconds) a login cookie should be stored in browser. The default of 0 means that it will be kept for the existing session only, and will be deleted as soon as you close the browser window. This is recommended for non-trusted environments.'=>'Anger hur lång tid (i sekunder) som en inloggnings-cookie ska lagras i webbläsaren. Standardvärdet 0 innebär att den sparas endast under befintlig session, och kommer tas bort så snart webbläsaren stängs. Detta är rekommenderat för icke tillförlitliga miljöer.','Define whether the previous login should be recalled or not in [kbd]cookie[/kbd] authentication mode.'=>'Ange om den tidigare inloggningen ska återkallas eller inte vid [kbd]cookie[/kbd]-autentiseringsläge.','If TRUE, logout deletes cookies for all servers; when set to FALSE, logout only occurs for the current server. Setting this to FALSE makes it easy to forget to log out from other servers when connected to multiple servers.'=>'Om TRUE raderas cookies för alla servrar vid utloggning; när satt till FALSE sker utloggning endast för aktuell server. Satt till FALSE gör det lätt att glömma att logga ut från andra servrar när du är ansluten till flera servrar.','Default format; be aware that this list depends on location (database, table) and only SQL is always available.'=>'Standardformat; observera att denna lista beror på plats (databas, tabell) och endast SQL är alltid tillgängligt.','Allow interrupt of import in case script detects it is close to time limit. This might be a good way to import large files, however it can break transactions.'=>'Tillåt avbrott av import ifall skriptet upptäcker att det är nära tidsbegränsningen. Detta kan vara ett bra sätt att importera stora filer, men det kan bryta transaktioner.','If enabled, phpMyAdmin continues computing multiple-statement queries even if one of the queries failed.'=>'Om aktiverat fortsätter phpMyAdmin att utföra fleruttrycksfrågor även om en av frågorna misslyckades.','Enable gzip compression for import and export operations.'=>'Aktivera gzip-komprimering för import- och exportoperationer.','Tracking of changes made in database. Requires the phpMyAdmin configuration storage.'=>'Spårning av ändringar i databasen. Kräver phpMyAdmin konfigurations lagring.','Configure phpMyAdmin configuration storage to gain access to additional features, see [doc@linked-tables]phpMyAdmin configuration storage[/doc] in documentation.'=>'Ställ in konfigurationslagring för phpMyAdmin för att få tillgång till ytterligare funktionalitet, se [doc@linked-tables]konfigurationslagring för phpMyAdmin[/doc] i dokumentationen.','Advanced server configuration, do not change these options unless you know what they are for.'=>'Avancerad serverkonfiguration, ändra inte dessa alternativ om du inte vet vad de är till för.','Please note that phpMyAdmin is just a user interface and its features do not limit MySQL.'=>'Observera att phpMyAdmin endast är ett användargränssnitt och dess funktioner inte begränsar MySQL.','Specify browser\'s title bar text. Refer to [doc@faq6-27]documentation[/doc] for magic strings that can be used to get special values.'=>'Ange webbläsarens namnlisttext. Se [doc@faq6-27]Table]documentation[/doc] för magiska strängar som kan användas för att få speciella värden.','Sort order for items in a foreign-key dropdown box; [kbd]content[/kbd] is the referenced data, [kbd]id[/kbd] is the key value.'=>'Sorteringsordning för poster i en främmande nyckel-listruta; [kbd]innehåll[/kbd] är refererad data, [kbd]id[/kbd] är nyckelvärdet.','Add IF NOT EXISTS (less efficient as indexes will be generated during table creation)'=>'Lägg till "IF NOT EXISTS" (mindre effektiv eftersom index kommer att genereras när tabellen skapas)','Set the number of seconds a script is allowed to run ([kbd]0[/kbd] for no limit).'=>'Ange antalet sekunder ett skript får köras ([kbd]0[/kbd] för ingen begränsning).','Disable the table maintenance mass operations, like optimizing or repairing the selected tables of a database.'=>'Inaktivera mängdoperationer för tabellunderhåll, som att optimera eller reparera de valda tabellerna i en databas.','Whether a warning ("Are your really sure…") should be displayed when you\'re about to lose data.'=>'Anger om en varning ("Är du riktigt säker…") ska visas när du håller på att förlora data.','Compress gzip exports on the fly without the need for much memory; if you encounter problems with created gzip files disable this feature.'=>'Komprimera gzip-exporter i farten utan att det behövs mycket minne; inaktivera funktionen om du får problem med skapade gzip-filer.','Defines the maximum size for input fields generated for CHAR and VARCHAR columns.'=>'Anger den maximala storleken för inmatningsfält skapade för CHAR- och VARCHAR-kolumner.','Defines the minimum size for input fields generated for CHAR and VARCHAR columns.'=>'Definierar minsta storlek för inmatningsfält skapade för CHAR- och VARCHAR-kolumner.','Find any errors in the query before executing it. Requires CodeMirror to be enabled.'=>'Rätta till sökningen innan du kör den. Kräver att "CodeMirror" aktiveras.','Use user-friendly editor for editing SQL queries (CodeMirror) with syntax highlighting and line numbers.'=>'Använd användarvänlig editor för att redigera SQL-frågor (CodeMirror) med syntaxmarkering och radnummer.','Defines which type of editing controls should be used for CHAR and VARCHAR columns; [kbd]input[/kbd] - allows limiting of input length, [kbd]textarea[/kbd] - allows newlines in columns.'=>'Anger vilken typ av redigeringskontroll som ska användas för CHAR- och VARCHAR-fält; [kbd]input[/kbd] - tillåter begränsning av inmatningens längd, [kbd]textarea[/kbd] - tillåter radbrytningar i kolumner.','Enable bzip2 compression for import operations.'=>'Aktivera bzip2-komprimering av importoperationer.','Secret passphrase used for encrypting cookies in [kbd]cookie[/kbd] authentication.'=>'Hemlig lösenordsfras som används för kryptering av cookies i [kbd]cookie[/kbd]-autentisering.','Enabling this allows a page located on a different domain to call phpMyAdmin inside a frame, and is a potential [strong]security hole[/strong] allowing cross-frame scripting (XSS) attacks.'=>'Om detta aktiveras tillåts att en sida som ligger på en annan domän anropar phpMyAdmin i en ram, vilket är ett potentiellt [strong]säkerhetshål[/strong] som tillåter XSS-angrepp (cross-frame scripting).','Restricts the MySQL servers the user can enter when a login to an arbitrary MySQL server is enabled by matching the IP or hostname of the MySQL server to the given regular expression.'=>'Begränsar de MySQL-servrar användaren kan ange när en inloggning till en godtycklig MySQL-server aktiveras genom att matcha IP- eller värdnamnet för MySQL-servern till det givna reguljära uttrycket.','Current selection does not contain a unique column. Grid edit, Edit, Copy and Delete features may result in undesired behavior. %s'=>'Nuvarande markering innehåller ingen unik kolumn. Funktionerna rutnätsredigera, kryssruta, redigera, kopiera och radera kan orsaka oönskat resultat, %s','Current selection does not contain a unique column. Grid edit, checkbox, Edit, Copy and Delete features are not available. %s'=>'Nuvarande markering innehåller ingen unik kolumn. Funktionerna rutnätsredigera, kryssruta, redigera, kopiera och radera är inte tillgängliga. %s','You can execute the dump by creating and using a temporary database. Please ensure that you have the privileges to do so.'=>'Du kan dumpa genom att skapa och använda en tillfällig databas. Se till att du har behörighet att göra det.','The web server does not have permission to save the file %s.'=>'Webbservern har inte behörighet att spara filen %s.','File %s already exists on server, change filename or check overwrite option.'=>'Filen %s finns redan på servern, ändra filnamnet eller kontrollera ersättningsalternativet.','This usually means there is a syntax error in it, please check any errors shown below.'=>'Detta betyder oftast att det finns ett syntaxfel i den, kontrollera eventuella fel som visas nedan.','Wrong permissions on configuration file, should not be world writable!'=>'Fel behörigheter på konfigurationsfilen, bör inte vara "world" skrivbar!','There are large item groups in navigation panel which may affect the performance. Consider disabling item grouping in the navigation panel.'=>'Det finns stora artikelgrupper i navigeringspanelen som kan påverka prestanda. Överväga att inaktivera objektgruppering i navigeringspanelen.','This view has at least this number of rows. Please refer to %sdocumentation%s.'=>'Denna vy har åtminstone detta antal rader. Se %sdokumentationen%s.','Version %1$s was created for selected tables, tracking is active for them.'=>'Version %1$s är skapad, spårning är aktiverad.','phpMyAdmin was unable to kill thread %s. It probably has already been closed.'=>'phpMyAdmin kunde inte döda tråd %s. Troligtvis har den redan avslutats.','Server running with Suhosin. Please refer to %sdocumentation%s for possible issues.'=>'Server körs med Suhosin. Se %sdokumentation%s för möjliga problem.','Or alternately go to \'Operations\' tab of any database to set it up there.'=>'Eller alternativt gå till "Drift" fliken i någon databas till sätta den upp där.','The phpMyAdmin configuration storage is not completely configured, some extended features have been deactivated. %sFind out why%s. '=>'phpMyAdmin-konfigurationen är inte fullständigt konfigurerad, vissa utökade funktioner har inaktiverats. För att ta reda på varför klicka %shär%s. ','Directory [code]config[/code], which is used by the setup script, still exists in your phpMyAdmin directory. It is strongly recommended to remove it once phpMyAdmin has been configured. Otherwise the security of your server may be compromised by unauthorized people downloading your configuration.'=>'Katalogen [code]config[/code], som används av installationsskriptet, finns fortfarande i din phpMyAdmin-katalog. Det rekommenderas kraftigt att ta bort den när phpMyAdmin har konfigurerats. I annat fall kan din servers säkerhet hotas av obehöriga som laddar ner din konfiguration.','Login cookie store is lower than cookie validity configured in phpMyAdmin, because of this, your login will expire sooner than configured in phpMyAdmin.'=>'Login-cookie lagras kortare tid än giltighetstiden som är konfigurerad i phpMyAdmin, på grund av detta kommer dina inloggningsuppgifter upphöra att gälla tidigare än konfigurerats i phpMyAdmin.','The curl extension was not found and allow_url_fopen is disabled. Due to this some features such as error reporting or version check are disabled.'=>'Curl-tillägget kunde inte hittas och allow_url_fopen är avstängt. På grund av detta är vissa funktioner, som felrapportering och versionskontroll, avstängda.','The mbstring PHP extension was not found and you seem to be using a multibyte charset. Without the mbstring extension phpMyAdmin is unable to split strings correctly and it may result in unexpected results.'=>'PHP-tillägget mbstring kunde inte hittas och det verkar som om du använder flerbitars teckenuppsättning. phpMyAdmin kan inte dela upp strängar korrekt utan tillägget mbstring, vilket kan resultera i oväntade resultat.','The %s file is not available on this system, please visit %s for more information.'=>'Filen %s är inte tillgänglig i detta system, gå till %s för mer information.','If you experience any problems please submit a bug report manually.'=>'Skicka en buggrapport manuellt om du upplever några problem.','An error has been detected and an error report has been generated but failed to be sent.'=>'Ett fel har upptäckts och en felrapport har skapats men kunde inte skickas.','An error has been detected and an error report has been automatically submitted based on your settings.'=>'Ett fel har upptäckts och en felrapport har skickats automatiskt i enlighet med dina inställningar.','Username and hostname didn\'t change. If you only want to change the password, \'Change password\' tab should be used.'=>'Användarnamn och hostname ändra inte. Om du bara vill ändra lösenordet, bör \'Ändra lösenord\' -flik användas.','Allows connecting, even if maximum number of connections is reached; required for most administrative operations like setting global variables or killing threads of other users.'=>'Tillåter uppkoppling, även om maximala antalet förbindelser är nådd. Nödvändig för de flesta administrativa funktioner, som att sätta globala variabler eller döda andra användares trådar.','The phpMyAdmin configuration storage has been deactivated. %sFind out why%s.'=>'PhpMyAdmins konfigurationslagring har inaktiverats. %sSe varför%s.','As per your settings, they are being submitted currently, please be patient.'=>'Enligt dina inställningar, ha tålamod.','Warning: a form on this page has more than %d fields. On submission, some of the fields might be ignored, due to PHP\'s max_input_vars configuration.'=>'Varning: ett formulär på den här sidan har mer än %d fält. Då det skickas kan några av fälten ignoreras på grund av max_input_vars-inställningen för PHP.','A newer version of phpMyAdmin is available and you should consider upgrading. The newest version is %s, released on %s.'=>'En nyare version av phpMyAdmin finns tillgänglig och du bör uppgradera. Den senaste versionen är %s, publicerad den %s.','Do you really want to see all of the rows? For a big table this could crash the browser.'=>'Vill du se alla rader? För en stor tabell kan detta krasch webbläsaren.','This table does not contain a unique column. Features related to the grid edit, checkbox, Edit, Copy and Delete links may not work after saving.'=>'Denna tabell innehåller inte en unik kolumn. Funktioner relaterade till nätet redigera, kryssruta, redigera, kopiera och radera-länkar kanske inte fungerar när du har sparat.','Shift+Click to add this column to ORDER BY clause or to toggle ASC/DESC.<br>- Ctrl+Click or Alt+Click (Mac: Shift+Option+Click) to remove column from ORDER BY clause'=>'Skift-klicka för att lägga till kolumnen i villkoret ORDER BY eller för att växla mellan ASC/DESC.<br>-Ctrl-klicka eller Alt-klicka (Mac: Skift+Alt+klicka) för att  ta bort kolumnen ur villkoret ORDER BY (sortera på)','You have edited some data and they have not been saved. Are you sure you want to leave this page before saving the data?'=>'Du har redigerat en del data och de har inte sparats. Är du säker på att du vill lämna denna sida innan du sparar uppgifterna?','You haven\'t saved the changes in the layout. They will be lost if you don\'t save them. Do you want to continue?'=>'Du har inte sparat ändringarna i layouten. Dessa kommer förloras om du inte sparar dem. Vill du fortsätta?','Indicates that you have made changes to this page; you will be prompted for confirmation before abandoning changes'=>'Anger att du har gjort ändringar på denna sida; du uppmanas att bekräfta bortdöende från förändringar','MySQL accepts additional values not selectable by the datepicker; key in those values directly if desired'=>'MySQL accepterar fler värden som inte går att välja i datumväljaren; mata vid behov in dessa värden manuellt','MySQL accepts additional values not selectable by the slider; key in those values directly if desired'=>'MySQL accepterar ytterligare värden som inte går att välja med skjutreglaget; tryck in de värdena manuellt om du önskar','Sit tight! It may take few seconds depending on data size and column count of the table.'=>'Bara lugn! Det kan ta några sekunder beroende på data och kolumn räkna i tabellen.','Note: a, b -> d,f implies values of columns a and b combined together can determine values of column d and column f.'=>'Obs: a, b-> d f innebär värden i kolumner a och b tillsammans kan bestämma värdena i kolumn d och f.','No columns in the central list. Make sure the Central columns list for database %s has columns that are not present in the current table.'=>'Inga kolumner i huvud listan. Kontrollera att huvudlistan för databasen %s har kolumner som inte finns i den aktuella tabellen.','It seems that the connection to server has been lost. Please check your network connectivity and server status.'=>'Det verkar som om anslutningen till servern har förlorats. Kontrollera din nätverksanslutning och att servern fungerar.','While requesting new chart data the server returned an invalid response. This is most likely because your session expired. Reloading the page and reentering your credentials should help.'=>'När ny diagramdata begärdes, returnerade servern ett ogiltigt svar. Detta beror troligen på att din session har upphört. Om du laddar om sidan och matar in dina inloggningsuppgifter igen borde det lösa problemet.','Since grouping of INSERTs queries has been selected, INSERT queries into the same table are also being grouped together, disregarding of the inserted data.'=>'Sedan gruppering av INSERT-frågor har valts, är INSERT-frågor till samma tabell också grupperade tillsammans, oberoende av det data som infogats.','This column shows the amount of identical queries that are grouped together. However only the SQL query itself has been used as a grouping criteria, so the other attributes of queries, such as start time, may differ.'=>'Denna kolumn visar antalet identiska frågor som är grupperade tillsammans. Men endast SQL-frågan själv blir jämförd, så därför kan frågornas andra attribut som starttid variera.','You can\'t change these variables. Please log in as root or contact your database administrator.'=>'Du kan inte ändra dessa variabler. Logga in som root eller kontakta din databasadministratör.','Following settings will be applied globally and reset to default on server restart:'=>'Följande inställningar kommer appliceras globalt och återställs till standardvärdet när servern startas om:','slow_query_log is enabled, but the server logs only queries that take longer than %d seconds. It is advisable to set this long_query_time 0-2 seconds, depending on your system.'=>'slow_query_log är aktiverad, men servern loggar endast frågor som tar längre tid än %d sekunder. Det är lämpligt att definiera long_query_time till 0-2 sekunder, beroende på ditt system.','The chart arrangement configuration in your browsers local storage is not compatible anymore to the newer version of the monitor dialog. It is very likely that your current configuration will not work anymore. Please reset your configuration to default in the <i>Settings</i> menu.'=>'Diagrammets arrangemang i din webbläsares lokala lagring är inte kompatibelt längre med den nyare versionen av övervakarens dialogruta. Det är mycket troligt att din nuvarande konfiguration inte fungerar längre. Återställ konfigurationen i <i>Inställningar</i>-menyn.','Through this operation, MySQL attempts to map the data values between collations. If the character sets are incompatible, there may be data loss and this lost data may <b>NOT</b> be recoverable simply by changing back the column collation(s). <b>To convert existing data, it is suggested to use the column(s) editing feature (the "Change" Link) on the table structure page. </b>'=>'Genom denna operation försöker MySQL kartlägga värden mellan sorteringar. Om teckenuppsättningarna är inkompatibla kan dataförlust ske och förlorad data kan vara <b>OMÖJLIG</b> att återställa genom att ändra tillbaks kolumnen/kolumnernas sortering. <b>För att konvertera existerande data föreslås användande av kolumnens/kolumnernas redigeringsverktyg ("Ändra") på tabellstruktur sidan.</b>','This operation will attempt to convert your data to the new collation. In rare cases, especially where a character doesn\'t exist in the new collation, this process could cause the data to appear incorrectly under the new collation; in this case we suggest you revert to the original collation and refer to the tips at '=>'Denna operation kommer att försöka konvertera data till den nya sorteringsordningen. I sällsynta fall, kan särskilt där en karaktär inte finns i den nya sorteringsordningen, denna process orsaka att data visas felaktigt under den nya sorteringsordningen; i detta fall föreslår vi att u återgå till den ursprungliga sorteringen och hänvisar till tips på ','Do you really want to DROP the selected partition(s)? This will also DELETE the data related to the selected partition(s)!'=>'Vill du verkligen släppa valda partitionen/partitionerna? Detta tar också bort uppgifterna om den valda partitionen/partitionerna!','However on last run no data has been parsed, this usually means phpMyAdmin won\'t be able to finish this import unless you increase php time limits.'=>'Dock blev inga data bearbetade i senaste körningen. Detta betyder vanligtvis att phpMyAdmin inte kan slutföra denna import såvida du inte ökar PHP:s tidsbegränsningar.','Script timeout passed, if you want to finish import, please %sresubmit the same file%s and import will resume.'=>'Timeout för skript passerade, om du vill avsluta import, vänligen %sresubmit samma fil%s och import kommer att återupptas.','No data was received to import. Either no file name was submitted, or the file size exceeded the maximum size permitted by your PHP configuration. See [doc@faq1-16]FAQ 1.16[/doc].'=>'Inga data att importera mottogs. Antingen angavs inget filnamn eller så översteg filens storlek den maximalt tillåtna storleken i din PHP-konfiguration. Se [doc@faq1-16]FAQ 1.16[/doc].','You probably tried to upload a file that is too large. Please refer to %sdocumentation%s for a workaround for 